import React from "react";
import styled from "styled-components";
import Image from "next/image";
import { TertiaryButton } from "../../UI/Links";
import Body from "../../layout/Body";

import imageSrc1 from "../../../assets/images/product/eeimage1.jpg";
import imageSrc2 from "../../../assets/images/product/eeimage2.jpg";
import imageSrc3 from "../../../assets/images/product/eeimage3.jpg";

export const EnergyEfficiency = () => {
  return <Container>EnergyEfficiency</Container>;
};

export const EnergyEfficiencyProduct = ({}) => {
  return (
    <Container>
      <ImageContainer1>
        <Image src={imageSrc1} objectFit="cover" layout="fill" />
      </ImageContainer1>
      <Text>
        <Title>Energy Efficiency.</Title>
        <Body>
          <ul>
            <li>Rated Most efficient by Energy Star</li>

            <li>
              Warm edge spacers recessed between the panes of glass both
              minimize glass edge conductivity while optimally containing the
              argon gas within the sealed units, obtaining a 90% argon gas fill
              rate
            </li>
          </ul>
        </Body>
        <TertiaryButton href="/sub/energyefficiency">
          More on Energy Efficiency
        </TertiaryButton>
      </Text>
      <ImageContainer2>
        <Image src={imageSrc2} objectFit="cover" layout="fill" />
      </ImageContainer2>
      <ImageContainer3>
        <Image src={imageSrc3} objectFit="cover" layout="fill" />
      </ImageContainer3>
    </Container>
  );
};

const Container = styled.div`
  display: grid;
  grid-template-columns: 1fr 1fr;
  grid-template-rows: min-content;
`;

const ImageContainer = styled.div`
  display: grid;
  position: relative;
`;

const ImageContainer1 = styled(ImageContainer)`
  grid-row: span 2;
`;

const ImageContainer2 = styled(ImageContainer)``;

const ImageContainer3 = styled(ImageContainer)``;

const Text = styled.div`
  display: grid;
`;

const Title = styled.h3`
  display: grid;
`;
